    /* Updated December 30, 2025 to fix the "clumpy" random issue on iPad.
       1. Switched to hardware-level randomness (window.crypto).
       2. Added a cache-buster (?t=) to force Safari to refresh every time.
    */

    function startRedirect() {

      // list of all Chess Steps books
      const books = [
        step2, 
        step2extra, 
        step2plus, 
        step2mix, 
        step2thinkingahead, 
        step3, 
        step3extra, 
        step3plus, 
        step3mix, 
        step3thinkingahead,
        step4
      ];

      // Hardware-level random function for iPad
      function getSecureRandomInt(max) {
        const array = new Uint32Array(1);
        window.crypto.getRandomValues(array);
        return array[0] % max;
      }

      // 1. Pick a book using hardware entropy
      const randomBook = books[getSecureRandomInt(books.length)];

      // 2. Pick a puzzle from that book using hardware entropy
      const randomPuzzle = randomBook[getSecureRandomInt(randomBook.length)];
      
      // 3. Create a "Cache Buster" using the current time in milliseconds
      const cacheBuster = "?t=" + Date.now();

      // 4. Force a fresh redirect
      window.location.replace("https://lichess.org/study/" + randomPuzzle + cacheBuster);
    }
